import React from 'react';
import './style.css';

export default function PoolHistoryItem() {
  return (
    <div className="poolHistoryItem">
      <div className="poolHistoryItemStatusWrapper">
        <div className="poolHistoryItemStatusLine"></div>

        <div className="poolHistoryItemStatusDot"></div>
      </div>

      <div className="poolHistoryItemTitle">Pool has been created</div>
      <div className="poolHistoryItemDate">July 19, 2020 2:09</div>
    </div>
  );
}
